const Note = ({ note }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Title</th>
          <th>Author</th>
          <th>Url</th>
          <th>Likes</th>
        </tr>
      </thead>
      <tbody>
        <tr key={note.id}>
          <td>{note.title}</td>
          <td>{note.author}</td>
        </tr>
      </tbody>
    </table>
  );
};

export default Note;
